"use strict";

var t = require("babel-types");

module.exports = function () {
  return {
    visitor: {
      JSXAttribute: function JSXAttribute(path) {
        var node = path.node;

        if (t.isJSXIdentifier(node.name) && node.name.name === "cacheKey") {
          path.remove();
        }
      }
    }
  };
};